import React from "react";

export default function Items(props) {
  const item = props.item;
  return (
    <section>
      <h3>{item.title}</h3>
      <table>
        <tr>
          <th>Firstname</th>
          <th>Lastname</th>
          <th>Age</th>
        </tr>
      </table>
    </section>
  );
}
